import Button from './Button'
import './Section.css'
const Section = ({sec}) => 
{
    switch(sec)
    {
        case 1:
        {
            return(
                <div>
                    <div>
                    <Button ID={'Get Started'}/>
                    <Button ID={'Live Chat'}/>
                    </div>
                </div>
            )
        }
        case 2:
        {
            return(
                <div className="second">
                    
                </div>
            )
        }
        default:
        {
            /*return (
                    
            )*/
        }            
    }
}

export default Section
